	private static void printTitles(String str) {
		String[] sArr = str.split(",");
		for (int i = 0; i < sArr.length; i++) {
			if (sArr[i].contains("part")) {
				System.out.println(sArr[i].replaceAll("\"part\":", "").replaceAll("\"", "").replaceFirst("_", ".").replaceFirst("_", " ").replaceAll("\\[高清版\\]", "").replaceAll("-bilibili", ""));
			}
		}
	}
	
	private static void printDurations(String str) {
		String[] sArr = str.split(",");
		String s = "";
		Integer n = null;
		for (String value : sArr) {
			if (value.contains("duration")) {
				n = Integer.parseInt(value.replaceAll("\"duration\":", "").replaceAll("\"", "").replaceFirst("_", ".").replaceFirst("_", " ").replaceAll("\\[高清版\\]", "").replaceAll("-bilibili", ""));
				s = "";
				while (n > 0) {
					if (StringUtils.isNotBlank(s)) {
						s = "." + s;
					}
					s = MathUtils.fmtLength(n % 60, 2) + s;
					n /= 60;
				}
				if (!s.contains(".")) {
					s = "0." + s;
				}
				System.out.println(s);
			}
		}
	}
	
	private static void print(String str, String tag) {
		String[] sArr = str.split(",");
		for (int i = 0; i < sArr.length; i++) {
			if (sArr[i].contains(tag)) {
				System.out.println(sArr[i].replaceAll("\""+ tag + "\":", "").replaceAll("\"", "").replaceFirst("_", ".").replaceFirst("_", " ").replaceAll("\\[高清版\\]", "").replaceAll("-bilibili", ""));
			}
		}
	}
